INSERT INTO `tbl_faq` (`faq_id`, `faq_title`, `faq_content`) VALUES
(1, 'Việt Nam sẽ có cổng truy xuất nguồn gốc sản phẩm nông nghiệp', '<h3 class=\"checkout-complete-box font-bold txt16\" _mstvisible=\"2\" style=\"box-sizing: inherit; margin: 0.2rem 0px 0.5rem; padding: 0px; font-family: Roboto, sans-serif; line-height: 1.4; color: rgb(51, 51, 51); text-rendering: optimizelegibility; background-color: rgb(250, 250, 250);\"><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><b><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Việt Nam sẽ có cổng truy xuất nguồn\r\ngốc sản phẩm nông nghiệp</span></b><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Cổng thông tin quốc gia sẽ cung cấp bộ\r\ndữ liệu chung, theo tiêu chí quốc tế giúp truy xuất, kiểm soát chất lượng sản\r\nphẩm.<br></span><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Sáng 7/10, tại hội thảo chia sẻ ứng\r\ndụng sản xuất nông nghiệp hữu cơ thông minh và hệ thống truy xuất nguồn gốc đối\r\nvới các sản phẩm nông nghiệp, ông Nguyễn Hoàng Linh, Phó Tổng cục trưởng Tổng\r\ncục Tiêu chuẩn Đo lường Chất lượng đã thông tin về hoạt động xây dựng tiêu\r\nchuẩn nông nghiệp hữu cơ và truy xuất nguồn gốc các sản phẩm nông nghiệp của\r\nViệt Nam. Đây cũng là nội dung các chuyên gia đến từ các nước thành viên thuộc\r\nTổ chức năng suất châu Á (APO) chia sẻ tại hội thảo nhằm thúc đẩy sản xuất nông\r\nnghiệp hữu cơ thông minh và ứng dụng truy xuất nguồn gốc trong chuỗi cung ứng\r\nthực phẩm tại các quốc gia thành viên.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\"></span><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 100%;\"><i><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\"><br>\r\n<br>\r\n</span></i><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Các sản phẩm nông nghiệp hữu cơ sẽ có\r\ntem truy xuất nguồn gốc. Ảnh:&nbsp;<i>ST</i></span><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Ông Linh cho biết, bộ tiêu chuẩn quốc\r\ngia về nông nghiệp hữu cơ TCVN 11041 đã được Việt Nam ban hành năm 2017, đưa ra\r\ntiêu chuẩn chung đối với sản xuất, chế biến, ghi nhãn sản phẩm nông nghiệp hữu\r\ncơ; trồng trọt; chăn nuôi và yêu cầu đối với tổ chức đánh giá, chứng nhận hệ\r\nthống sản xuất và chế biến sản phẩm hữu cơ. Việc xây dựng hạ tầng chất lượng để\r\nhỗ trợ các hợp tác xã và người dân trong sản xuất nông nghiệp thông minh, nông\r\nnghiệp hữu cơ để đáp ứng yêu cầu xuất khẩu cũng được thực hiện.</span><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Theo Đề án 100 của Chính phủ ban hành,\r\nTổng cục đang chủ trì việc xây dựng cổng dữ liệu truy xuất nguồn gốc quốc gia.\r\nMục tiêu chung của cổng thông tin nhằm đảm bảo công khai, minh bạch các thông\r\ntin truy xuất nguồn gốc của sản phẩm, hàng hóa trên thị trường, cung cấp kiến\r\nthức về truy xuất nguồn gốc...</span><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Cổng thông tin truy xuất nguồn gốc sản\r\nphẩm, hàng hóa quốc gia bao gồm hệ thống phần cứng, phần mềm để phục vụ việc\r\ncung cấp thông tin về nguồn gốc sản phẩm, hàng hóa trên cơ sở kết nối với hệ\r\nthống truy xuất nguồn gốc của các bộ, cơ quan, tổ chức, doanh nghiệp và các hệ\r\nthống quốc tế được công nhận. \"Theo kế hoạch đến năm 2025 cổng thông tin\r\nnày đi vào vận hành nhưng chúng tôi đang cố gắng để hoàn thành trước thời gian\r\nnày\", ông Linh cho biết.</span><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Tại hội thảo, các chuyên gia đến từ\r\nCanada, Thụy Sĩ và Ấn Độ... cũng chia sẻ về xu hướng ứng dụng công nghệ nông\r\nnghiệp hữu cơ thông minh và hệ thống truy xuất nguồn gốc thông minh trên nền\r\ntảng web ứng dụng trong xuất nhập khẩu các sản phẩm hữu cơ được phát triển bởi\r\ncác tổ chức USDA, EU và cơ quan quản lý của Ấn Độ.&nbsp;</span><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p><p style=\"margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: SF-display, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" roboto,=\"\" arial,=\"\" sans-serif;=\"\" font-optical-sizing:=\"\" inherit;=\"\" font-kerning:=\"\" font-feature-settings:=\"\" font-variation-settings:=\"\" vertical-align:=\"\" baseline;=\"\" text-rendering:=\"\" optimizelegibility;=\"\" text-align:=\"\" justify;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size:13.0pt;font-family:Roboto;color:black;\">Theo ông Linh, các nước thành viên\r\nchia sẻ kinh nghiệm, cách thức triển khai sẽ giúp Việt Nam hoàn thiện hệ thống\r\npháp lý, hạ tầng để sản xuất nông nghiệp thông minh, nông nghiệp hữu cơ gắn với\r\ntruy xuất nguồn gốc, giúp sản phẩm nông sản Việt Nam đáp ứng được các hàng rào\r\nkỹ thuật, nâng cao năng lực các tổ chức chứng nhận để quốc tế chấp nhận.</span><span style=\"font-size:10.0pt;font-family:Roboto;color:black;\"></span></p></h3>\r\n');
INSERT INTO `tbl_faq` (`faq_id`, `faq_title`, `faq_content`) VALUES
(2, 'Tem QR Code truy xuất nguồn gốc - công cụ quản lý cho doanh nghiệp', '<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><b><span style=\"font-size: 13pt; font-family: Roboto;\">Tem QR Code truy xuất nguồn gốc - công\r\ncụ quản lý cho doanh nghiệp</span></b><span style=\"font-size: 10pt; font-family: Roboto;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Với tem QR Code, doanh nghiệp có thể truy xuất nguồn gốc\r\nxuất xứ của từng sản phẩm, qua đó nâng cao uy tín và chất lượng phục vụ.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Đa số các doanh nghiệp Việt Nam đều đã xây dựng quy trình\r\ntruy xuất nguồn gốc xuất xứ đối với sản phẩm của mình. Tuy nhiên, nhiều đơn vị\r\nlại thực hiện việc truy xuất nguồn gốc sản phẩm bằng phương pháp thủ công hoặc\r\ntự đưa ra mã vạch mã số theo quy chuẩn của riêng mình. Điều này khiến doanh\r\nnghiệp khó quản lý cũng như mở rộng thị trường trong khi người tiêu dùng cũng\r\nkhó kiểm tra được thông tin xuất xứ sản phẩm.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 100%;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><br></span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Doanh nghiệp sử dụng tem QR Code để truy xuất nguồn gốc cho\r\nsản phẩm của mình (Ảnh: <i>petrotimes.vn</i>).</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Hiện nay, một số doanh nghiệp đã chuyển sang sử dụng các\r\ngiải pháp truy xuất nguồn gốc sản phẩm bằng công nghệ quét mã QR Code. Trong số\r\ncác giải pháp được doanh nghiệp ưa chuộng, tem QR Code truy xuất nguồn gốc sản\r\nphẩm của iCheck mang lại nhiều lợi ích.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><b><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Minh bạch thông tin sản phẩm</span></b><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Tem QR Code là cách doanh nghiệp công khai minh bạch nguồn\r\ngốc xuất xứ của sản phẩm đến người tiêu dùng ngay trên smartphone.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Sau thao tác quét mã QR Code, các thông tin như nhà sản\r\nxuất, tên sản phẩm, thông tin link web, giá, hình ảnh về sản phẩm, quy trình\r\nsản xuất... sẽ được gửi đến người tiêu dùng đầy đủ, rõ ràng, chính xác và nhanh\r\nchóng. Điều này cũng góp phần làm cho thông tin về sản phẩm trở nên sống động,\r\nđầy đủ hơn.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><b><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Tiết kiệm chi phí, nhân lực</span></b><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Trước khả năng sản phẩm bị làm nhái làm giả, doanh nghiệp\r\nluôn vất vả tìm cách phổ biến cho khách hàng cách phân biệt hàng chính hãng -\r\nhàng kém chất lượng. Tuy nhiên việc làm này lại tốn kém khá nhiều chi phí, công\r\nsức mà hiệu quả mang lại đôi khi không như doanh nghiệp mong muốn.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Thông qua việc minh bạch thông tin và nguồn gốc xuất xứ,\r\ndoanh nghiệp sẽ giúp khách hàng của mình có cơ sở nhận định về chất lượng cùng\r\ntính chính hãng của sản phẩm trước khi mua. Ngoài việc có thể truy xuất nguồn\r\ngốc sản phẩm, tem QR Code của iCheck còn có khả năng thay thế tem bảo hành, nhờ\r\nvậy tiết kiệm tiền bạc, thời gian và nhân lực cho doanh nghiệp.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><b><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Nâng cao năng lực cạnh tranh trong ngành</span></b><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Cùng một mặt hàng nhưng trên thị trường luôn tồn tại hàng\r\ntrăm sản phẩm đến từ các thương hiệu cả trong nước lẫn ngoài nước. Đối với\r\ndoanh nghiệp Việt Nam, sử dụng tem QR Code truy xuất nguồn gốc xuất xứ sẽ giúp\r\nsản phẩm tạo sự khác biệt và thu hút khách hàng.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 100%;\"></span><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><br></span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Người tiêu dùng quen dần với thao tác check mã Code truy\r\nxuất nguồn gốc sản phẩm.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Hàng hóa sau khi được gắn tem QR Code của iCheck và quét\r\nbởi app iCheck Scanner sẽ nhận được dấu tích xanh gắn trên logo tài khoản doanh\r\nnghiệp. Nhờ đó, sản phẩm của doanh nghiệp sẽ nhận thêm sự tín nhiệm của người\r\ntiêu dùng, góp phần nâng cao năng lực cạnh tranh và doanh thu bán hàng.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><b><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Bảo vệ thương hiệu, uy tín doanh nghiệp</span></b><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Doanh nghiệp luôn phải đối mặt nguy cơ kẻ xấu \"lợi\r\ndụng\" thương hiệu, đưa sản phẩm kém chất lượng đến tay người tiêu dùng.\r\nĐiều này ảnh hưởng xấu đến uy tín cũng như doanh thu của doanh nghiệp. Mọi công\r\nsức tạo dựng hình ảnh và niềm tin về doanh nghiệp trong lòng khách hàng có thể\r\nsụp đổ nếu tình tràn hàng giả, hàng nhái không được ngăn chặn kịp thời.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Trong cuộc chiến giành lại thị phần và hình ảnh đã mất bởi\r\nhàng giả, tem QR Code sẽ là công cụ đắc lực hỗ trợ doanh nghiệp. Doanh nghiệp\r\nsẽ dễ dàng quản lý sản phẩm trên thị trường, ngăn chặn và xử lý kịp thời nguy\r\ncơ hàng giả, hàng nhái thông qua từng hành vi quét mã QR Code của người tiêu\r\ndùng.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Thông tin sản phẩm sau khi quét mã QR Code (Ảnh:<i> ichecksale.com</i>).</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><b><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Tạo dựng niềm tin đối với người tiêu dùng</span></b><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Tem QR Code truy xuất nguồn gốc sản phẩm là giải pháp thông\r\nminh nhằm đáp ứng nhu cầu muốn biết tường tận về nguồn gốc xuất xứ sản phẩm của\r\nngười tiêu dùng, từ khâu sản xuất cho đến quá trình vận chuyển, bảo quản trước\r\nkhi đến tay khách hàng. Từ đó, doanh nghiệp sẽ tạo dựng và định vị được thương\r\nhiệu \"chính hãng\" trong tâm trí người tiêu dùng.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Xét dưới góc độ của doanh nghiệp, tem QR Code truy xuất\r\nnguồn gốc sản phẩm là bí quyết gia tăng hiệu quả truyền thông và bán hàng trong\r\nthời buổi hàng giả, hàng kém chất lượng tràn lan gây ra tâm lý lo ngại đến\r\nngười tiêu dùng.</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;text-align:justify;line-height:normal;\"><span style=\"font-size: 13pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">(Nguồn: <i>iCheck</i>)</span><span style=\"font-size: 10pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"></span></p><p style=\"margin-bottom: 1.25em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: SF-display, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" roboto,=\"\" arial,=\"\" sans-serif;=\"\" font-optical-sizing:=\"\" inherit;=\"\" font-kerning:=\"\" font-feature-settings:=\"\" font-variation-settings:=\"\" vertical-align:=\"\" baseline;=\"\" text-rendering:=\"\" optimizelegibility;=\"\" text-align:=\"\" justify;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);\"=\"\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:13.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",serif;\"=\"\"><br clear=\"all\" style=\"page-break-before:always;\">\r\n</span>\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",serif;\"=\"\"> </span></p>\r\n');
INSERT INTO `tbl_faq` (`faq_id`, `faq_title`, `faq_content`) VALUES
(3, 'Thực phẩm an toàn và nông sản sạch - Xu hướng tiêu dùng hiện đại', '<div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\"><span style=\"margin: 0px auto; padding: 0px; font-weight: bolder;\">Hiện nay, nhiều doanh nghiệp Việt Nam đã đầu tư mạnh hơn vào khâu chế biến, đa dạng hóa sản xuất, liên kết với nhau tạo thành phong trào sản xuất nông sản hữu cơ và phát triển rộng khắp cả nước.</span></div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Viện Nghiên cứu Chiến lược Thương hiệu và Cạnh tranh (BCSI) vừa&nbsp;tổ chức sự kiện: \"<span style=\"margin: 0px auto; padding: 0px; font-weight: bolder;\">Diễn đàn khuynh hướng tiêu dùng Việt Nam 2023: Xu hướng và Thị trường bán lẻ.</span>\" Tại sự kiện, ông Nguyễn Minh Tiến, Giám đốc Trung tâm Xúc tiến thương mại nông nghiệp chia sẻ, gần đây, xu hướng thực phẩm an toàn có nguồn gốc tự nhiên, thân thiện môi trường trở nên phổ biến và trở thành xu hướng tiêu dùng hiện đại. Đây là xu thế tất yếu không chỉ ở Việt Nam mà trên toàn thế giới.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: center;\"><img alt=\"\" data-cke-saved-src=\"/Images/Upload/User/toquyen/2023/6/dua_hau.jpg\" src=\"http://scp.gov.vn/Images/Upload/User/toquyen/2023/6/dua_hau.jpg\" style=\"margin: 0px auto; padding: 0px; max-width: 750px; height: auto !important;\"></div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: center;\"><span style=\"margin: 0px auto; padding: 0px; color: rgb(0, 0, 255);\"><em style=\"margin: 0px auto; padding: 0px;\">Thu hoạch dưa hấu tại Hậu Giang&nbsp;</em></span></div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Ở Việt Nam, xu hướng tiêu dùng sản phẩm nông sản sạch cũng không nằm ngoài hướng đi chung. Để xu hướng trên có thể phát triển hơn nữa, Việt Nam đang và sẽ có một số yếu tố thuận lợi như thu nhập của người tiêu dùng tăng cao sẽ có sự chú ý đến sức khỏe của mình nhiều hơn, sẵn sàng trả chi phí cao hơn để có được những sản phẩm yên tâm về chất lượng, tốt cho sức khỏe; nền sản xuất phát triển cả về chất lượng, số lượng và phong phú về chủng loại, thân thiện với môi trường; các kênh phân phối cũng đang được phát triển đa dạng và hiện đại...</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Hiện nay, nhiều doanh nghiệp đã đầu tư mạnh hơn vào khâu chế biến, đa dạng hóa sản xuất, liên kết với nhau tạo thành phong trào sản xuất nông sản hữu cơ và phát triển rộng khắp cả nước. Việc sản xuất, canh tác hữu cơ tăng cả về chiều rộng lẫn chiều sâu trong 5 năm năm gần đây đã giúp gia tăng giá trị kim ngạch xuất khẩu với hơn 300 triệu USD/năm, đáp ứng thị trường nội địa và vươn xa tới thị trường khoảng 180 nước.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Ngoài ra, nhận thức của người sản xuất cũng ngày một nâng cao hơn khi đã có sự chú trọng về áp dụng khoa học kỹ thuật, quy trình sản xuất đảm bảo vệ sinh an toàn thực phẩm, đáp ứng các yêu cầu của cơ quan quản lý và đặc biệt là nhu cầu của khách hàng.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: center;\"><img alt=\"\" data-cke-saved-src=\"/Images/Upload/User/toquyen/2023/6/thong_nhat.jpeg\" src=\"http://scp.gov.vn/Images/Upload/User/toquyen/2023/6/thong_nhat.jpeg\" style=\"margin: 0px auto; padding: 0px; max-width: 750px; height: auto !important;\"></div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: center;\"><em style=\"margin: 0px auto; padding: 0px;\"><span style=\"margin: 0px auto; padding: 0px; color: rgb(0, 0, 255);\">Công nhân Công ty Cổ phần cao su Thống Nhất, Bà Rịa-VŨng Tàu,kiểm tra độ phát triển của chuối hữu cơ Nam Mỹ.&nbsp;</span></em></div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Hệ thống bán lẻ hiện đại tại Việt Nam hiện chỉ chiếm khoảng 25% tổng mức bán lẻ, thấp hơn so với các nước trong khu vực như 33% ở Philippines, 34% ở Thái Lan, 60% ở Malaysia, 90% ở Singapore...Trong khi đó, các kênh bán lẻ hiện đại có tốc độ tăng trưởng rất mạnh mẽ, đạt 11,8%/năm so với tốc độ khoảng 1% của chợ truyền thống.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Hàng hóa trong các hệ thống bán lẻ hiện đại đa số được kiểm soát về chất lượng, mẫu mã và giá cả; hệ thống phân phối, logistics chuyên nghiệp hơn so với chợ truyền thống nên hàng hóa được đảm bảo chất lượng khi đến tay người tiêu dùng. Tuy nhiên, ngành nông nghiệp, nông sản Việt Nam hiện nay vẫn sản xuất nhỏ lẻ nên khâu kiểm soát chế biến sau thu hoạch vẫn còn yếu.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Thông tin thị trường phát triển nhập khẩu nông sản không được cập nhật, nắm vững nên sản phẩm thương mang tính tự sản xuất, không đảm bảo các tiêu chuẩn để xuất khẩu nước ngoài.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Để xu hướng sử dụng, tiêu dùng nông sản sạch được phát triển bền vững, hướng tới một cộng đồng khỏe mạnh, cần phải có những giải pháp căn cơ và sát sườn, ông Tiến nhấn mạnh.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Bà Đặng Thúy Hà, Giám đốc miền Bắc NielsenIQ Việt Nam nhận định theo thời gian người tiêu dùng ngày càng coi trọng yếu tố bền vững.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Các yếu tố quan trọng khi lựa chọn thương hiệu của người tiêu dùng gồm giá thành hợp lý, bảo đảm an toàn và vệ sinh, tốt cho sức khỏe, thương hiệu tin cậy, sự bền vững và thân thiện môi trường…</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">55% người tiêu dùng được NielsenIQ Việt Nam khảo sát ngay trong năm 2023 đánh giá cao yếu tố bền vững trong tiêu dùng.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: center;\"><img alt=\"\" data-cke-saved-src=\"/Images/Upload/User/toquyen/2023/6/dua_luoi.jpg\" src=\"http://scp.gov.vn/Images/Upload/User/toquyen/2023/6/dua_luoi.jpg\" style=\"margin: 0px auto; padding: 0px; max-width: 750px; height: auto !important;\"></div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: center;\"><em style=\"margin: 0px auto; padding: 0px;\"><span style=\"margin: 0px auto; padding: 0px; color: rgb(0, 0, 255);\">Vườn dưa lưới hữu cơ sử dụng toàn bộ phân phân trùn quế tại Trang trại Nắng và Gió, Ninh Sơn, Ninh Thuận.&nbsp;</span></em></div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Để minh chứng, bà Hà cho biết 49% người tiêu dùng mang túi riêng hay sử dụng túi tái chế khi mua sắm, 47% chỉ mua đồ cần thiết và tránh lãng phí. Khi ở nhà 45% có ý thức tiết kiệm điện và 45% phân loại rác tái chế…</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Đánh giá cụ thể từ nghiên cứu riêng về người tiêu dùng Hà Nội và Thành phố Hồ Chí Minh, bà Trịnh Nguyễn Ngọc Linh, Quản lý cấp cao Dự án Intage Việt Nam cho biết 95% người tiêu dùng ở hai thành phố lớn này có ý thức về việc bảo vệ môi trường; 59% người tiêu dùng lựa chọn ăn rau xanh, ngũ cốc thường xuyên hơn; 61% ưu tiên tận dụng ánh sáng tự nhiên nhiều nhất có thể, 44% tái sử dụng quần áo cũ thay vì mua mới không cần thiết…</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Nghiên cứu này cũng chỉ ra các phân khúc người tiêu dùng nhận thức về tiêu dùng xanh, trong đó 24% cho biết sống xanh để tiết kiệm, 22% tiêu dùng xanh để tập trung cho sức khỏe; 9% đồng hành với trào lưu…</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Ông Đỗ Văn Việt, đại diện Hiệp hội Thương mại điện tử Việt Nam cho biết ngày càng nhiều người tiêu dùng lựa chọn thương mại điện tử là kênh mua sắm thường xuyên bởi sự tiện ích nhiều mặt.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Hiện, thương mại điện tử ở Việt Nam phát triển nhanh chóng với tốc độ tăng trưởng 2 con số/năm. Ngày càng nhiều doanh nghiệp, người bán hàng chuyển mạnh sang thương mại điện tử để tiếp cận người tiêu dùng, nhất là trên các kênh như mạng xã hội, trí tuệ nhân tạo.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Dẫn ví dụ về việc Tỉnh Đoàn Bắc Giang đang triển khai bán trái vải thiều trên TikTok Shop Việt Nam, ông Đỗ Đức Việt cho biết nhiều phiên bán hàng live stream chỉ trong vài tiếng có thể bán hàng tấn vải với hàng nghìn đơn hàng.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">\"<em style=\"margin: 0px auto; padding: 0px;\">Doanh nghiệp cần nắm bắt xu hướng, có giải pháp tiếp cận các kênh thương mại điện tử và cần triển khai đa kênh để tạo nhiều điểm chạm với khách hàng,</em>\" ông Việt khuyến nghị.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Gợi ý tới các doanh nghiệp sản xuất và bán lẻ, bà Đặng Thúy Hà đưa ra các giải pháp mang tính ngắn hạn, trung và dài hạn.</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Đó là phát triển mô hình bán lẻ mới gắn với trải nghiệm sản phẩm xanh, thành lập câu lạc bộ khách hàng tiêu dùng bền vững, thưởng điểm khi mua sản phẩm bền vững… Hoặc thay thế, giảm thiểu nhựa trong bao bì; phát triển nhà máy, trang trại trung hòa carbon như cách mà Vinamilk đang làm nhằm cắt giảm 15% lượng phát thải khí nhà kính vào năm 2027; sử dụng phương tiện vận tải chạy điện, phát triển nông nghiệp tái sinh…</div><div style=\"margin: 1em 0px; padding: 0px; font-size: 15px; color: rgb(33, 37, 41); font-family: Roboto, arial, serif; text-align: justify;\">Trước xu hướng tiêu dùng sản phẩm an toàn, đặc biệt là sản phẩm hữu cơ với doanh số tại Việt Nam đạt 208 tỷ USD năm 2022, ông Minh Tiến khuyến nghị giải pháp, các cơ quan chức năng cần kiểm soát chất lượng nông sản trên thị trường, nâng cao hiệu quả bảo vệ người tiêu dùng; đẩy mạnh thông tin tuyên truyền để người sản xuất sạch thấy được giá trị của việc sản xuất theo tiêu chuẩn, người tiêu dùng hiểu được giá trị của nông sản sạch; đặc biệt cần nâng cao năng lực sản xuất nông sản đáp ứng nhu cầu thị trường.</div><div><br></div>\r\n');

