(1, 'Giới Thiệu', '<p class=\"MsoNormal\" style=\"text-align: justify; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\">Chào mừng bạn đến với Truy xuất nguồn gốc nông sản sạch\r\nThiện Tiến, nền tảng truy xuất nguồn gốc nông sản sạch bằng công nghệ QR code\r\nhiện đại và tiện lợi. Với mong muốn mang đến sự minh bạch và an toàn cho người\r\ntiêu dùng, Thiện Tiến cho phép bạn dễ dàng kiểm tra thông tin chi tiết về sản\r\nphẩm nông sản từ quá trình trồng trọt, thu hoạch đến vận chuyển và phân phối.\r\nChỉ cần quét mã QR trên sản phẩm, bạn sẽ có ngay những thông tin cần thiết như\r\nnguồn gốc, nhà sản xuất, quy trình canh tác, và chứng nhận chất lượng. Hãy cùng\r\nchúng tôi xây dựng một thị trường nông sản sạch và bền vững, bảo vệ sức khỏe của\r\nbạn và gia đình.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<b>TẦM NHÌN, SỨ MỆNH, GIÁ TRỊ CỐT LÕI</b><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b>Tầm nhìn:</b><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\">Truy xuất nguồn gốc nông sản sạch Thiện Tiến hướng đến\r\ntrở thành nền tảng hàng đầu trong việc đảm bảo tính minh bạch và an toàn của\r\nnông sản Việt Nam. Chúng tôi mong muốn xây dựng một hệ sinh thái nông nghiệp bền\r\nvững, nơi mà người tiêu dùng có thể hoàn toàn tin tưởng vào chất lượng và nguồn\r\ngốc của các sản phẩm nông sản sạch.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b>Sứ mệnh:</b><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\">Mang lại các sản phẩm 100% hữu cơ, an toàn chất lượng,\r\nbảo vệ môi trường, tạo sự chuyển biến tích cực cho bà con trong sản xuất nông\r\nnghiệp, không còn tư tưởng chạy theo năng suất, lợi nhuận trước mắt mà chú trọng\r\nhơn vào chất lượng an toàn thực phẩm của sản phẩm.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b>Giá trị cốt lõi:</b><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\">XANH – SẠCH – CHẤT</span></p><p class=\"MsoNormal\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b><br></b></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b>ĐIỀU KIỆN ĐẢM BẢO THÔNG TIN TRUY XUẤT NGUỒN GỐC</b></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"></span><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 100%;\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b><br></b><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b><br></b></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b><br></b></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b>SƠ ĐỒ QUY TRÌNH TRUY XUẤT NGUỒN GỐC</b></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"></span><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 100%;\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><b><br></b><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:13.0pt;line-height:107%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif\"=\"\"><o:p></o:p></span></p>', 'about-banner.png', 'Giới Thiệu', '', '', 'Tin tức', 'faq-banner.png', 'Tin Tức', '', '', 'Blog', 'blog-banner.jpg', 'Ecommerce - Blog', '', '', 'Liên hệ', 'contact-banner.png', 'Liên hệ', '', '', 'Photo Gallery', 'pgallery-banner.jpg', 'Ecommerce - Photo Gallery', '', '', 'Video Gallery', 'vgallery-banner.jpg', 'Ecommerce - Video Gallery', '', '');

